import React from "react";
import SignUp from "./SignUp";
import SignIn from "./SignIn";
import { Link } from "react-router-dom";

const LandingPage = () => {
  return (
    <div className="landingpage">
      <div className="landingpage__loginsignup">
        <Link className="landingpage__loginsignup--signin" to="/signin">
          Sign In
        </Link>
        <Link className="landingpage__loginsignup--signup" to="/signup">
          Sign Up
        </Link>
      </div>
      <div className="landingpage__welcome"> Welcome to Mini Casino</div>
      <Link to="/gamelib" className="landingpage__gamelib">
        To Popular Games
      </Link>
      <Link to="/gamble">gamble</Link>
    </div>
  );
};

export default LandingPage;
